            <div class="carousel" id="carousel-3"><img src={Carousel3} height="100%" width="100%"/></div>
        </div>
        
        <div className="carousel-links">  
        <a href="#carousel-1">  O </a> 
        <a href="#carousel-2">  O </a> 
        <a href="#carousel-3"> O  </a> 
        </div>
        </div>
    );
};

